<!DOCTYPE html>

<body>

<script>

    });
</script>

    </div>
</article>

</div>

<div id="footer"></div>
<script>
    document.addEventListener("DOMContentLoaded", function() {
        fetch("/components/footer.html")
            .then(response => response.text())
